<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Large Number Calculator (BigInt)</title>
    <style>
        body { font-family: Arial, sans-serif; margin: 40px; }
        input, select, button { font-size: 1.2em; margin: 10px 0; width: 100%; }
        .result { font-size: 1.3em; margin-top: 20px; font-style: italic; }
        .container { max-width: 400px; margin: auto; padding: 20px; border: 1px solid #ddd; border-radius: 8px; background: #f9f9f9; }
    </style>
</head>
<body>
    <div class="container">
        <h2>Large Number Calculator (BigInt)</h2>
        <label>First</label><label> Number:</label>
        <input id="num1" type="text" placeholder="Enter large integer">

        <label>Operation:</label>
        <select id="operation">
            <option value="add">+</option>
            <option value="subtract">−</option>
            <option value="multiply">×</option>
            <option value="divide">÷</option>
            <option value="power">^ (pow)</option>
        </select>

        <label>Second Number:</label>
        <input id="num2" type="text" placeholder="Enter large integer">

        <button onclick="calculate()">Calculate</button>
        <div class="result" id="result"></div>
    </div>

    <script>
        function calculate() {
            const num1Str = document.getElementById('num1').value.trim();
            const num2Str = document.getElementById('num2').value.trim();
            const op = document.getElementById('operation').value;
            const resultBox = document.getElementById('result');

            try {
                // Parse BigInt values
                const a = BigInt(num1Str);
                const b = BigInt(num2Str);

                let result;
                switch(op) {
                    case 'add':
                        result = a + b;
                        break;
                    case 'subtract':
                        result = a - b;
                        break;
                    case 'multiply':
                        result = a * b;
                        break;
                    case 'divide':
                        if (b === 0n) throw new Error("Division by zero!");
                        result = a / b;
                        break;
                    case 'power':
                        if (b < 0n) throw new Error("Exponent must be non-negative!");
                        result = a ** b;
                        break;
                    default:
                        throw new Error("Unknown operation");
                }
                resultBox.textContent = "Result: " + result.toString();
            } catch (e) {
                resultBox.textContent = "Error: " + (e.message || e);
            }
        }
